import React from 'react'
import { useDispatch } from 'react-redux';
import { getAllStudents } from '../../action/student/studentAction'

export function LoadAllAdminData(params) {
    useDispatch(getCurrentUser(sessionStorage.getItem("user")))
    useDispatch(getAllStudents());

    return null
}
